<i>About six of us met up on Sunday evening and went to the Humane Society of Alachua County. We walked dogs for awhile and when we were done they allowed us to play with the dogs in play areas. Evan did a great job refilling the water bowls of all the thirsty dogs. Finally, we paid the cats a visit and gave them some much needed love and attention. Go gators!</i>
